        <div id="fundo_industria"class="row">
                <div id="text_industria" class="col-md-6" >
                    <h2 class="h2_indus">SAIBA MAIS SOBRE A INDÚSTRIA 4.0</h2><br>
                    <div class="text_indus">
                        <p>
                        A tecnologia é um importante instrumento de transformação no mundo, contribuindo
                        com aumento da qualidade de vida e preservação do meio ambiente. Nesse contexto, a
                        indústria 4.0 facilita a execução e a visão das conhecidas “fábricas inteligentes”, pois
                        apresenta estruturas em módulos.<br>
                        A maior parte do processo de produção na quarta revolução industrial é automatizada e o
                        elemento humano está presente mais para acompanhar do que para realizar o trabalho.
                        Outras características desse modelo são as criações e o monitoramento dos processos
                        físicos pelos sistemas ciber-físicos, que criam uma cópia virtual da estrutura física – o que
                        contribui para a tomada de decisões de forma descentralizada e efetiva.<br>
                        As tecnologias desenvolvidas a partir da indústria 4.0 também possibilitam uma série de
                        oportunidades no que diz respeito à agregação de valor, do produto aos clientes.<br>
                        No aumento da produtividade encontramos outro ponto importante, a indústria 4.0 é
                        extremamente tecnológica, digital e faz o uso de instrumentos como Big Data, Internet das
                        Coisas e Inteligência Artificial para automatização dos processos e das máquinas.
                        </p>
